import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/App';
import { ContextProvider } from './Context';

ReactDOM.render(
  <React.StrictMode>
<BrowserRouter />
    <ContextProvider>
    <App />
  </ContextProvider>,
  </React.StrictMode>,
  document.getElementById('root')
);
